import logo from './logo.svg';
import './App.css';
import Nav from './components/Nav.js'
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import SingUp from './components/SignUp.js';
import PrivateRoute from './components/privateRoute.js';
import Login from './components/Login.js';
import AddProduct from './components/ProductAdd.js';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Nav/>
      <Routes>
        <Route element={<PrivateRoute/>}>

        <Route path='/' element={<h1>Prodcut List</h1>} />
        <Route path='/add' element={<AddProduct/>}/>
        <Route path='/update' element={<h1>Prodcut update</h1>}/>
        <Route path='/profile' element={<h1>User profile</h1>}/>
        <Route path='/logout' element={<h1>Logout Herer</h1>}/>
        </Route>

        <Route path='/signup' element={<SingUp/>}/>
        <Route path='/login' element={<Login/>}/>



      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
